import React from 'react';
import { useParams } from 'react-router-dom';
import { useState, useEffect } from 'react';
import { Button } from 'react-bootstrap';

function Parks() {
  const { activityName } = useParams();
  const [object, setObject] = useState([{}]);
  const request =
    'https://developer.nps.gov/api/v1/activities/parks?q=' +
    activityName +
    '&api_key=pwVAaI7eyJ3qGEpakWoicbKA0kCPdzM6KVyeH2mB';

  console.log(request);
  useEffect(() => {
    fetch(request)
      .then((res) => res.json())
      .then((data) => {
        setObject(data);
      });
  }, []);

  console.log(object);
  return (
    <div>
      <h1>Showing Results for National Parks that Offer: {activityName}</h1>

      {object === 'undefined' ? (
        <p>Loading...</p>
      ) : (
        object.parks.map((park, i) => (
          <div>
            <br></br> <Button key={i}>{park}</Button>
          </div>
        ))
      )}
    </div>
  );
}

export default Parks;
